import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for a product
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone 15 Pro Max');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Wait for the wishlist link and click it
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    await page.click('a:has-text("Your Wish List")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_clicked.png'));

    // Verify the wishlist page is displayed
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    const wishlistVisible = await page.isVisible('.wishlist-page');

    return {
      success: true,
      action: "Product added to wishlist",
      extractedData: { wishlistVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
